import Dashboard from '../components/admin/Dashboard';
import Products from '../components/admin/Products';
import Customers from '../components/admin/Customers';
import Users from '../components/admin/Users';

const routes = [ 
    { path: '/admin', exact:true, name: 'Admin'},
    { path: '/admin/dashboard', exact:true, name: 'Admin', component: Dashboard},
    { path: '/admin/product-management', exact:true, name: 'Products', componen: Products},
    { path: '/admin/customer-management', exact:true, name: 'Customers', componen: Customers},
    { path: '/admin/user-management', exact:true, name: 'Users', componen: Users}
];

export default routes;
